軽量・ハイシート、たっぷり荷物が積める両対面ベビーカー「シティライトRアップ」から、大人気のキティちゃんデザインが登場！大きなリボン、キティちゃんのお顔のダイカットデザインがとってもキュートな1台です。<br>ハイシート52、収納力：32L（耐荷重量5）<br>【付属品】本体 × １ ヘッドサポート × １ 取扱説明書 × １<br><br>■対象年齢：生後1カ月から3歳頃まで 体重15まで<br>■サイズ：開：W460×D820-890×H950～995(） 　閉：W460×D355×H965(）<br>■重量：4.8（フル装備 ヘッドサポート込重量4.9kg）<br>■備考：米国安全基準　ASTM準拠<br>5点式シートベルト【素材】本体：アルミニウム　ポリプロピレン　ABS樹脂 など　縫製：ポリエステル、ナイロン<br>【GRACO（グレコ）】<!--関連商品--><br><div class=reltitle> </div><div class=relink><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/aprica/4969220670737x.jpg?_ex=80x80 border=0><div class=rel_name>グレコ CitiLiteR　シティライト Rプラス ポルカドット</div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/aprica/4969220670744x.jpg?_ex=80x80 border=0><div class=rel_name>グレコ CitiLiteR シティライト Rプラス ピンクボーダー</div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/aprica/4969220670751x.jpg?_ex=80x80 border=0><div class=rel_name>グレコ CitiLiteR シティライト Rプラス ブラックボーダー</div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/aprica/4969220673134x.jpg?_ex=80x80 border=0><div class=rel_name>グレコ ベビーカー CitiLiteR シティライト Rプラス ミッキーマウス（ＢＲ）</div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/aprica/4969220673707x.jpg?_ex=80x80 border=0><div class=rel_name>グレコ ベビーカー　シティカーゴ　2013年モデル カーゴブラック</div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/aprica/4969220673714x.jpg?_ex=80x80 border=0><div class=rel_name>グレコ ベビーカー　シティカーゴ　2013年モデル カーゴグリーン</div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/aprica/4969220673721x.jpg?_ex=80x80 border=0><div class=rel_name>グレコ ベビーカー　シティカーゴ　2013年モデル カーゴピンク</div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/aprica/4969220673806x.jpg?_ex